import { Button, FormControl, TextField } from "@mui/material";
function Form() {
  return (
    <>
    <FormControl>
        <TextField 
            type='text' 
            placeholder='name' 
            sx={{margin:'20px'}}
        />
        <TextField 
            type='email' 
            placeholder='email'  
            sx={{margin:'20px'}} 
        />
        <TextField 
            type='password' 
            placeholder='password'  
            sx={{margin:'20px'}}
        />
        <Button variant="outlined" sx={{padding:'5px'}}>Submit</Button>

    </FormControl>
      
    </>
  )
}

export default Form;
